const ImageLinkForm = () => {
    return(
        <div>
            <p>
                {'Enter the link of a picture and detect all the faces!'}
            </p>
            <div>
                <input className='f4 pa2' type="text" id="URL" name="URL" placeholder="website.com/image.jpg"/>
                <button className='f4 pa2'>Detect Faces</button>
            </div>
        </div>
    );
}

export default ImageLinkForm;
